import React from "react";

function Header(props) {
  const { name, color } = props;
  return (
    <div>
      <h1>
        {name},{color}
        <h1>{Math.random() >= 0.5 ? "Over 0.5" : "Under 0.5"}</h1>
      </h1>
    </div>
  );
}

export default Header;
